import s from './Components/App/app.module.css'
import {BrowserRouter, Route} from 'react-router-dom';
import Header from "./Components/Header/Header";
import HeaderCenter from "./Components/HeaderCenter/HeaderCenter";
import HeaderBottom from "./Components/HeaderBottom/HeaderBottom";
import CenterHeader from "./Components/CenterHeader/CenterHeader";
import PizzaContainer from "./Components/CenterHeader/Pizza/PizzaContainer";
import SneksContainer from "./Components/CenterHeader/Sneks/SneksContainer";
import DrinkContainer from "./Components/CenterHeader/Drink/DrinkContainer";
import SousContainer from "./Components/CenterHeader/Sous/SousContainer";
import CenterCenter from "./Components/CenterCenter/CenterCenter";
import CenterBottom from "./Components/CenterBottom/CenterBottom";
import FooterHeader from "./Components/FooterHeader/FooterHeader";
import FooterCenter from "./Components/FooterCenter/FooterCenter";
import FooterBottom from "./Components/FooterBottom/FooterBottom";


function App(props) {
    return (

        <BrowserRouter>
            <div className={s.App}>
                <Header/>
                <HeaderCenter/>
                <HeaderBottom/>
                <CenterHeader/>
                <Route path="/pizza" render={() => <PizzaContainer
                />}/>
                <Route path="/sneks" render={() => <SneksContainer
                />}/>
                <Route path="/drink" render={() => <DrinkContainer
                />}/>
                <Route path="/sous" render={() => <SousContainer
                />}/>
                <CenterCenter/>
                <CenterBottom/>
                <FooterHeader/>
                <FooterCenter/>
                <FooterBottom/>
                <Route path={"/pizza/" + props.pizza.id} render={() => <DrinkContainer
                />}/>

            </div>
        </BrowserRouter>

    );
}

export default App;
